import React from "react";

const AboutPage = () => {
  return (
    <div>
      <h1>About Our Shop</h1>
      <p>
        Welcome to our shop! We are dedicated to providing the best products and
        services to our customers.
      </p>
      <p>
        Our goal is to offer a wide range of high-quality products, ensuring an
        excellent shopping experience.
      </p>
      <p>
        At our shop, you'll find everything from apparel to electronics and much
        more.
      </p>
      <p>
        For any inquiries or support, feel free to contact our customer service
        team.
      </p>
    </div>
  );
};

export default AboutPage;
